import React from 'react';
import 'react-responsive-carousel/lib/styles/carousel.min.css';

const styles = {
  app: {
    textAlign: 'center',
    backgroundColor: '#f4f4f4',
    minHeight: '100vh',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center', // Align items in the center horizontally
  },
  header: {
    backgroundColor: '#333',
    color: 'white',
    padding: '10px', /* Added padding */
    width: '100%', // Set header to full width
    boxSizing: 'border-box', // Include padding and border in the width
  },
  nav: {
    backgroundColor: '#444',
    color: 'white',
    padding: '20px',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    height: '40px',
    width: '100%', // Set nav to full width
    boxSizing: 'border-box', // Include padding and border in the width
  },
  logo: {
    marginLeft: '20px',
    fontSize: '1.5rem',
    fontWeight: 'bold',
  },
  navUl: {
    listStyleType: 'none',
    padding: 0,
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  },
  navLi: {
    margin: '0 15px',
    cursor: 'pointer',
  },
  loginButton: {
    backgroundColor: '#555',
    color: 'white',
    padding: '10px 15px',
    borderRadius: '5px',
    cursor: 'pointer',
    marginRight: '20px',
  },
  aboutSection: {
    marginTop: '20px', /* Adjusted margin */
    marginBottom: '75px',
    textAlign: 'left', /* Aligned to left */
    paddingLeft: '20px', /* Added left padding */
  },
  introductionHeading: {
    fontSize: '2rem', /* Increased font size */
    fontWeight: 'bold',
    color: '#333', /* Changed color */
  },
  introductionContent: {
    fontSize: '1.2rem',
    color: '#555',
  },
  ourWorksSection: {
    marginTop: '100px',
    marginBottom: '75px',
    width: '80%', // Set the width of the our works section
  },
  sliderContainer: {
    display: 'flex',
    justifyContent: 'space-between',
    marginBottom: '50px',
    flexWrap: 'wrap', // Allow the sliders to wrap to the next line
  },
  slider: {
    width: '30%', // Set the width of each slider
    marginBottom: '20px', // Add margin to create space between sliders
    boxSizing: 'border-box', // Include padding and border in the width
  },
};

const Header = () => (
  <header style={styles.header}>
    {/* Removed website name */}
  </header>
);

const NavBar = () => (
  <nav style={styles.nav}>
    <div style={styles.logo}>Logo</div>
    <ul style={styles.navUl}>
      <li style={styles.navLi}>Home</li>
      <li style={styles.navLi}>Our Missions</li>
      <li style={styles.navLi}>About Us</li>
      <li style={styles.navLi}>Clubs</li>
      <li style={styles.navLi}>Contact Us</li>
    </ul>
    <div style={styles.loginButton}>Login</div>
  </nav>
);

const AboutSection = () => (
  <div style={styles.aboutSection}>
    <div>
      <h1 style={styles.introductionHeading}>Introduction</h1>
      <p style={styles.introductionContent}>This is the introduction</p>
    </div>
  </div>
);

const Slider = () => (
  <div style={styles.slider}>
    {/* Placeholder for slider */}
    Slider
  </div>
);

const OurWorksSection = () => (
  <div style={styles.ourWorksSection}>
    <h2>Our Works</h2>
    <div style={styles.sliderContainer}>
      <Slider />
      <Slider />
      <Slider />
      <Slider />
      <Slider />
      <Slider />
    </div>
  </div>
);

const App = () => (
  <div style={styles.app}>
    <Header />
    <NavBar />
    <AboutSection />
    <OurWorksSection />
    {/* Include other components and sections as needed */}
  </div>
);

export default App;
